import React, { useState } from "react";

const App = () => {
  const [likes, setLikes] = useState();

  const increment = () => {
    setLikes(likes + 1);
  };

  return (
    <div>
      <h1>{likes}</h1>
      <button></button>
      <button></button>{" "}
    </div>
  );
};

export default App;
